-- Name: v_broker_daily_net; Type: VIEW; Schema: public; Owner: -
--

CREATE VIEW public.v_broker_daily_net AS
 SELECT stock_code,
    date,
    broker_code,
    buy_value,
    sell_value,
    net_value,
    buy_lot,
    sell_lot,
    net_lot,
        CASE
            WHEN (net_value > (0)::numeric) THEN 'accumulation'::text
            WHEN (net_value < (0)::numeric) THEN 'distribution'::text
            ELSE 'neutral'::text
        END AS flow_type
   FROM public.broker_summary
  ORDER BY date, net_value DESC;


